import React from "react";
import { Link } from "react-router-dom";

export default function HomePage({ cards, loading, error }) {
  return (
    <div
      style={{
        maxWidth: "1100px",
        margin: "20px auto",
        padding: "20px",
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
        color: "#34495e",
      }}
    >
      <div
        style={{
          textAlign: "center",
          marginBottom: "40px",
          padding: "20px",
          backgroundColor: "#f7f9fc",
          borderRadius: "10px",
          boxShadow: "0 4px 10px rgba(0,0,0,0.05)",
        }}
      >
        <h1 style={{ color: "#1e88e5", fontWeight: "700" }}>Bienvenido a WhaleCorp</h1>
        <p style={{ fontSize: "18px", maxWidth: "600px", margin: "0 auto", color: "#66788a" }}>
          A page made with love ♥
        </p>
      </div>

      {loading ? (
        <div style={{ textAlign: "center", margin: "50px 0" }}>
          <div className="spinner" />
          <p style={{ color: "#95a5a6", fontSize: "16px" }}>Cargando personajes...</p>
        </div>
      ) : error ? (
        <div style={{ textAlign: "center", margin: "50px 0", color: "#e74c3c" }}>
          <p>Error al cargar los datos: {error}</p>
          <button
            onClick={() => window.location.reload()}
            style={{
              padding: "10px 20px",
              background: "#1e88e5",
              color: "white",
              border: "none",
              borderRadius: "6px",
              cursor: "pointer",
              fontWeight: "600",
              fontSize: "16px",
              marginTop: "15px",
              boxShadow: "0 2px 6px rgba(30,136,229,0.4)",
              transition: "background-color 0.3s ease",
            }}
            onMouseOver={(e) => (e.currentTarget.style.backgroundColor = "#1565c0")}
            onMouseOut={(e) => (e.currentTarget.style.backgroundColor = "#1e88e5")}
          >
            Reintentar
          </button>
        </div>
      ) : cards.length === 0 ? (
        <div style={{ textAlign: "center", margin: "50px 0", color: "#7f8c8d", fontSize: "18px" }}>
          <p>No hay tarjetas disponibles</p>
          <Link
            to="/login"
            style={{
              display: "inline-block",
              marginTop: "20px",
              padding: "10px 25px",
              background: "#1e88e5",
              color: "white",
              textDecoration: "none",
              borderRadius: "8px",
              fontWeight: "600",
              boxShadow: "0 2px 6px rgba(30,136,229,0.4)",
              transition: "background-color 0.3s ease",
            }}
            onMouseOver={(e) => (e.currentTarget.style.backgroundColor = "#1565c0")}
            onMouseOut={(e) => (e.currentTarget.style.backgroundColor = "#1e88e5")}
          >
            Inicia sesión como administrador
          </Link>
        </div>
      ) : (
        <div>
          <h2
            style={{
              textAlign: "center",
              marginBottom: "30px",
              color: "#2c3e50",
              fontWeight: "700",
              letterSpacing: "1px",
            }}
          >
            Pending Raids
          </h2>
          <div
            style={{
              display: "grid",
              gridTemplateColumns: "repeat(4, 1fr)", // 4 columnas fijas
              gap: "24px",
              justifyItems: "stretch",
            }}
          >
            {cards.map((card, index) => (
              <div
                key={index}
                style={{
                  borderRadius: "14px",
                  overflow: "hidden",
                  boxShadow: "0 10px 20px rgba(0,0,0,0.08)",
                  backgroundColor: "#ffffff",
                  display: "flex",
                  flexDirection: "column",
                  cursor: "default",
                  transition: "transform 0.25s ease, box-shadow 0.25s ease",
                  width: "100%", // adaptamos al grid
                }}
                onMouseEnter={(e) => {
                  e.currentTarget.style.transform = "translateY(-6px)";
                  e.currentTarget.style.boxShadow = "0 20px 40px rgba(0,0,0,0.12)";
                }}
                onMouseLeave={(e) => {
                  e.currentTarget.style.transform = "translateY(0)";
                  e.currentTarget.style.boxShadow = "0 10px 20px rgba(0,0,0,0.08)";
                }}
              >
                <div
                  style={{
                    padding: "18px 22px",
                    backgroundColor: "#e3f2fd",
                    borderBottom: "1px solid #bbdefb",
                    userSelect: "none",
                  }}
                >
                  <h3
                    style={{
                      margin: 0,
                      color: "#1565c0",
                      fontWeight: "700",
                      fontSize: "1.3rem",
                      lineHeight: "1.15",
                      textOverflow: "ellipsis",
                      whiteSpace: "nowrap",
                      overflow: "hidden",
                    }}
                    title={card.title}
                  >
                    {card.title}
                  </h3>
                  <div
                    style={{
                      display: "flex",
                      justifyContent: "space-between",
                      fontSize: "14px",
                      color: "#607d8b",
                      marginTop: "6px",
                      fontWeight: "600",
                    }}
                  >
                    <span>{card.date || "Fecha no asignada"}</span>
                    <span>{card.time || "Hora no asignada"}</span>
                  </div>
                </div>

                <div
                  style={{
                    padding: "18px 22px",
                    flexGrow: 1,
                    display: "grid",
                    gridTemplateColumns: "repeat(2, 1fr)",
                    gap: "12px",
                    userSelect: "text",
                    minHeight: "auto",
                  }}
                >
                  {card.characters.length === 0 ? (
                    <p
                      style={{
                        color: "#90a4ae",
                        textAlign: "center",
                        padding: "30px 0",
                        gridColumn: "1 / -1",
                        fontWeight: "500",
                        fontStyle: "italic",
                      }}
                    >
                      Tarjeta pendiente de asignación
                    </p>
                  ) : (
                    card.characters.map((char, charIndex) => (
                      <div
                        key={charIndex}
                        style={{
                          padding: "10px 14px",
                          borderRadius: "12px",
                          backgroundColor: "#bbdefb",
                          display: "flex",
                          flexDirection: "column",
                          alignItems: "center",
                          fontWeight: "700",
                          color: "#0d47a1",
                          userSelect: "none",
                          boxShadow: "0 1px 3px rgba(0,71,173,0.3)",
                          transition: "background-color 0.3s ease",
                          textAlign: "center",
                          whiteSpace: "nowrap",
                          overflow: "hidden",
                          textOverflow: "ellipsis",
                        }}
                        title={char.label}
                      >
                        <div>{char.name}</div>
                        {char.label && (
                          <div
                            style={{
                              marginTop: "5px",
                              fontSize: "11px",
                              fontWeight: "600",
                              padding: "2px 6px",
                              borderRadius: "9999px",
                              backgroundColor: "#82b1ff",
                              color: "#0b3d91",
                              userSelect: "text",
                            }}
                          >
                            {char.label}
                          </div>
                        )}
                      </div>
                    ))
                  )}
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
}
